import React, { Component } from 'react'
import img from "../images/avatar.jpeg";
import "../style/home.css"

class home extends Component {
    render() {

    function downloadDV() {
        alert("CV indirme henüz hazır değil.");
    }

        return (
                <div className="home">
                        <div className="img">
                            <img src={img}></img>
                        </div>
                        <div className="home-info">
                            <h1>Ömer AKKOCA</h1>
                            <p>Yazılım Mühendisi</p>
                            <p>Web Geliştirici ve Tasarımcı</p>
                            <span onClick={this.downloadCV} className="buttonCV">CV İndir</span>
                        </div>
                </div>
        )
    }
}

export default home;
